import org.junit.Test;

import java.util.concurrent.TimeUnit;

import static org.junit.Assert.*;

/**
 * Created by desmond on 11/5/16.
 */
public class PalindromeTest {
    Palindrome p = new Palindrome();
    
    @Test
    public void testShortestPalindrome() throws Exception {
        long start = System.nanoTime();
        assertEquals("", p.shortestPalindrome(""));
        assertEquals("aa", p.shortestPalindrome("aa"));
        assertEquals("aaa", p.shortestPalindrome("aaa"));
        assertEquals("aaaaa", p.shortestPalindrome("aaaaa"));
        assertEquals("abbaabba", p.shortestPalindrome("aabba"));
        assertEquals("ababbabbbababbbabbaba", p.shortestPalindrome("ababbbabbaba"));
        assertEquals("", p.shortestPalindrome(""));
        assertEquals("", p.shortestPalindrome(""));
        assertEquals("", p.shortestPalindrome(""));
        assertEquals("baab", p.shortestPalindrome("aab"));
        assertEquals("a", p.shortestPalindrome("a"));
        assertEquals("aaacecaaa", p.shortestPalindrome("aacecaaa"));
        assertEquals("dcbabcd", p.shortestPalindrome("abcd"));
        System.out.println(TimeUnit.NANOSECONDS.toMillis(System.nanoTime() - start));
    }
}